actionConfiguration.body:
function () {
  const data = Ip_Type.run();
  return {
    backgroundColor: '#1e2025',
    title: {
      text: 'Public vs Private IP Distribution',
      left: 'center',
      top: '2%',
      textStyle: {
        color: '#ffffff',
        fontSize: 14
      }
    },
    tooltip: {
      trigger: 'item',
      formatter: '{a} <br/>{b} : {c} ({d}%)'
    },
    series: [{
      name: 'IP Distribution',
      type: 'pie',
      radius: ['35%', '65%'],
      center: ['50%', '50%'],
      data: data,
      label: {
        color: 'rgba(255, 255, 255, 0.8)',
        formatter: '{b}: {c} ({d}%)'
      },
      labelLine: {
        length: 15,
        length2: 10,
        lineStyle: {
          color: 'rgba(255, 255, 255, 0.8)'
        }
      },
      itemStyle: {
        color: function (params) {
          return params.dataIndex === 0 ? '#22c55e' : '#3b82f6';
        }
      }
    }],
    legend: {
      bottom: '5%',
      left: 'center',
      orient: 'horizontal',
      textStyle: {
        color: '#ccc'
      }
    },
    grid: {
      top: '5%',
      bottom: '10%',
      left: '0%',
      right: '0%',
      containLabel: true
    }
  };
}

