actionConfiguration.body:
function () {
  const processedData = [];
  let ssh_count = 0;
  let ftp_count = 0;
  let sql_count = 0;
  let http_count = 0;
  let https_count = 0;
  Port.data.forEach(item => {
    const ip = item.ip;
    const ports = item.ports;
    if (ports.includes(22)) ssh_count++;
    if (ports.includes(21)) ftp_count++;
    if (ports.includes(3306)) sql_count++;
    if (ports.includes(80)) http_count++;
    if (ports.includes(443)) https_count++;
    processedData.push({
      "SSH (Port 22)": ssh_count,
      "FTP (Port 21)": ftp_count,
      "SQL (Port 3306)": sql_count,
      "HTTP (Port 80)": http_count,
      "HTTPS (Port 443)": https_count
    });
  });
  return processedData;
}

