actionConfiguration.body:
function () {
  const processedData = Open_Ports.run();
  const aggregatedData = {
    "SSH (Port 22)": 0,
    "FTP (Port 21)": 0,
    "SQL (Port 3306)": 0,
    "HTTP (Port 80)": 0,
    "HTTPS (Port 443)": 0
  };
  processedData.forEach(data => {
    aggregatedData["SSH (Port 22)"] += data["SSH (Port 22)"];
    aggregatedData["FTP (Port 21)"] += data["FTP (Port 21)"];
    aggregatedData["SQL (Port 3306)"] += data["SQL (Port 3306)"];
    aggregatedData["HTTP (Port 80)"] += data["HTTP (Port 80)"];
    aggregatedData["HTTPS (Port 443)"] += data["HTTPS (Port 443)"];
  });
  const dataForBarChart = Object.entries(aggregatedData).map(([name, value]) => ({
    name,
    value
  }));
  return {
    backgroundColor: '#1e2025',
    title: {
      text: 'Critical Open Ports Distribution',
      left: 'center',
      top: '5%',
      textStyle: {
        color: '#ffffff',
        fontSize: 16
      }
    },
    tooltip: {
      trigger: 'item',
      formatter: '{b} : {c}'
    },
    legend: {
      bottom: '10%',
      left: 'center',
      orient: 'horizontal',
      textStyle: {
        color: '#ffffff'
      },
      data: Object.keys(aggregatedData)
    },
    xAxis: {
      type: 'category',
      data: dataForBarChart.map(item => item.name),
      axisLabel: {
        color: '#ffffff',
        fontSize: 12
      },
      axisLine: {
        lineStyle: {
          color: '#ffffff'
        }
      }
    },
    yAxis: {
      type: 'value',
      axisLabel: {
        color: '#ffffff',
        fontSize: 12
      },
      axisLine: {
        lineStyle: {
          color: '#ffffff'
        }
      }
    },
    series: [{
      name: 'Critical Open Ports',
      type: 'bar',
      data: dataForBarChart.map(item => item.value),
      itemStyle: {
        color: params => {
          const colors = ['#3b82f6', '#ffeb3b', '#22c55e', '#4caf50', '#9c27b0'];
          return colors[params.dataIndex];
        },
        borderRadius: 5
      }
    }],
    grid: {
      top: '15%',
      bottom: '20%',
      left: '10%',
      right: '10%',
      containLabel: true
    }
  };
}

