function () {
  const chartContainer = document.getElementById('chartContainer');
  if (!chartContainer) {
    console.error('Chart container not found.');
    return;
  }
  const chartInstance = echarts.init(chartContainer);
  const chartOption = DNS_Type.getEChartOption();
