actionConfiguration.body:
function () {
  const processedData = {
    "<30 days": 0,
    "30-60 days": 0,
    "60-90 days": 0,
    ">90 days": 0
  };
  SSL_Checker.data.forEach(item => {
    const {days_until_expiry} = item;
    if (days_until_expiry < 30) {
      processedData["<30 days"]++;
    } else if (days_until_expiry >= 30 && days_until_expiry <= 60) {
      processedData["30-60 days"]++;
    } else if (days_until_expiry > 60 && days_until_expiry <= 90) {
      processedData["60-90 days"]++;
    } else {
      processedData[">90 days"]++;
    }
  });
  return processedData;
}

