actionConfiguration.body:
function () {
  const processedData = [];
  let ipCount = 0;
  const isPublicIP = ip => {
    if (typeof ip === 'string') {
      return !ip.startsWith("10.") && !ip.startsWith("192.168.") && !(ip.startsWith("172.") && parseInt(ip.split(".")[1]) >= 16 && parseInt(ip.split(".")[1]) <= 31) && !ip.startsWith("127.") && !ip.startsWith("169.254.");
    }
    return false;
  };
  IP.data.forEach(item => {
    let records = item.records;
    let source = item.source;
    if (!records || !source) {
      console.log(`Skipping item due to missing records or source: ${JSON.stringify(item)}`);
      return;
    }
    if (source === "GCP" || source === "cloudflare") {
      records.forEach(record => {
        console.log(`Processing ${source} record:`, record);
        if (Array.isArray(record.ip)) {
          record.ip.forEach(ipEntry => {
            const ip = ipEntry.ip;
            const portScanResult = Port.data.find(scan => scan.ip === ip) || ({});
            const openPorts = portScanResult.ports ? portScanResult.ports.join(", ") : "None";
            if (isPublicIP(ip)) {
              ipCount++;
            }
            processedData.push({
              "Domain": record.domain || "Unknown",
              "IP": ip,
              "Subdomain": ipEntry.name || "Unknown",
              "Source": source,
              "Open Ports": openPorts
            });
          });
        } else {
          console.log(`Skipping ${source} record with no valid IP array: ${JSON.stringify(record)}`);
        }
      });
    } else {
      console.log(`Unknown source: ${source}`);
    }
  });
  console.log("Processed Data:", processedData);
  console.log("Total IP Count:", ipCount);
  return {
    processedData,
    total_ip_count: ipCount
  };
}

