function () {
  const processedData = [];
  DNS_Records.data.forEach(item => {
    let records = item.records;
    let source = item.source;
    if (!records || !source) {
      console.log(`Skipping item due to missing records or source: ${JSON.stringify(item)}`);
      return;
    }
    if (source === "cloudflare") {
      records.forEach(nestedItem => {
        console.log("testtinngg", nestedItem);
        nestedItem.records.forEach(record => {
          if (record && record.content) {
            const portScanResult = PortScans.data.find(scan => scan.ip === record.content) || ({});
            const openPorts = portScanResult.ports ? portScanResult.ports.join(", ") : "None";
            processedData.push({
              "Domain": nestedItem.domain,
              "Subdomain": record.name || item.domain,
              "IP": record.content,
              "Type": record.type,
              "Proxied": record.proxied,
              "Source": source,
              "Open Ports": openPorts
            });
          } else {
            console.log(`Skipping invalid cloudflare record: ${JSON.stringify(record)}`);
          }
        });
      });
    } else if (source === "GCP") {
      records.forEach(record => {
        if (record && Array.isArray(record.RRDATA)) {
          record.RRDATA.forEach(ip => {
            const portScanResult = PortScans.data.find(scan => scan.ip === ip) || ({});
            const openPorts = portScanResult.ports ? portScanResult.ports.join(", ") : "None";
            processedData.push({
              "Subdomain": record.NAME,
              "IP": ip,
              "Project Id": record.Project_ID,
              "Type": record.TYPE,
              "Source": source,
              "Open Ports": openPorts
            });
          });
        } else {
          console.log(`Skipping invalid GCP record: ${JSON.stringify(record)}`);
        }
      });
    } else {
      console.log(`Unknown source: ${source}`);
    }
  });
  console.log("Processed Data:", processedData);
  return processedData;
}

