export default {
	run() {
		let publicIPCount = 0;
		let privateIPCount = 0;

		IP.data.forEach(items => {
			let source = items.source;
			let records = items.records;

			if (source === "GCP" && Array.isArray(records)) {
				records.forEach(record => {
					if (record.External_Ip || record['ADDRESS/RANGE'] || record.PRIMARY_ADDRESS) {
						publicIPCount++;
					} else if (record.Internal_Ip || record.IP_ADDRESS || record.PEER_ADDRESS) {
						privateIPCount++;
					}
				});
			} else if (source === "cloudflare" && Array.isArray(records)) {
				records.forEach(record => {
					if (Array.isArray(record.ip)) {
						record.ip.forEach(ipEntry => {
							if (ipEntry.ip) {
								publicIPCount++;
							}
						});
					}
				});
			}
		});

		return [
			{ name: "Public IP", value: publicIPCount },
			{ name: "Private IP", value: privateIPCount }
		];
	},

	getEChartOption() {
		const data = this.run();

		return {
			backgroundColor: '#1e2025',
			title: {
				text: 'Public vs Private IP Distribution',
				left: 'center',
				top: '2%',
				textStyle: {
					color: '#ffffff',
					fontSize: 14,
				},
			},
			tooltip: {
				trigger: 'item',
				formatter: '{a} <br/>{b} : {c} ({d}%)'
			},
			series: [
				{
					name: 'IP Distribution',
					type: 'pie',
					radius: ['35%', '65%'],
					center: ['50%', '50%'],
					data: data,
					label: {
						color: 'rgba(255, 255, 255, 0.8)',
						formatter: '{b}: {c} ({d}%)'
					},
					labelLine: {
						length: 15,
						length2: 10,
						lineStyle: {
							color: 'rgba(255, 255, 255, 0.8)'
						}
					},
					itemStyle: {
						color: function (params) {
							return params.dataIndex === 0 ? '#22c55e' : '#3b82f6';
						}
					}
				}
			],
			legend: {
				bottom: '5%',
				left: 'center',
				orient: 'horizontal',
				textStyle: {
					color: '#ccc'
				},
			},
			grid: {
				top: '5%',
				bottom: '10%',
				left: '0%',
				right: '0%',
				containLabel: true
			}
		};
	},

	renderChart() {
		const chartContainer = document.getElementById('chartContainer');
		if (!chartContainer) {
			console.error('Chart container not found.');
			return;
		}

		const chartInstance = echarts.init(chartContainer);
		const chartOption = this.getEChartOption();

		console.log('Rendering chart with options:', chartOption);

		chartInstance.setOption(chartOption);
	}
};

