export default {
  run() {
    let gcp_count = 0;
    let cloudflare_count = 0;

    DNS.data.forEach(item => {
      const records = item.records;
      const source = item.source;

      if (source === "GCP") {
        // Count DNS records in GCP
        records.forEach(record => {
          if (record && Array.isArray(record.RRDATA)) {
            gcp_count ++ // Add all RRDATA entries
          }
        });
      } else if (source === "cloudflare") {
        // Count DNS records in Cloudflare
        records.forEach(record => {
					record.records.forEach(r=>{
						if (r && r.content) {
							cloudflare_count++; // Increment for each content entry
						}
					})

        });
      }
    });

    // Return data in the required format
    return [
      { x: "GCP", y: gcp_count },
      { x: "Cloudflare", y: cloudflare_count }
    ];
  },

