  run() {
    let publicDNSCount = 0;
    let privateDNSCount = 0;

    const isPublicIP = (ip) => {
      if (typeof ip === 'string') {
        return (
          !ip.startsWith("10.") && 
          !ip.startsWith("192.168.") && 
          !(ip.startsWith("172.") && parseInt(ip.split(".")[1]) >= 16 && parseInt(ip.split(".")[1]) <= 31)
        );
      }
      return false; 
    };

    DNS.data.forEach(items => {
      let source = items.source;
      let records = items.records;

      if (source === "GCP") {
        records.forEach(record => {
          if (record && Array.isArray(record.RRDATA)) {
            record.RRDATA.forEach(ip => {
              if (isPublicIP(ip)) {
                publicDNSCount++;
              } else {
                privateDNSCount++;
              }
            });
          }
        });
      } else if (source === "cloudflare") {
        records.forEach(record => {
          if (record.records) {
            record.records.forEach(r => {
              if (r && r.content && isPublicIP(r.content)) {
                publicDNSCount++;
              } else {
                privateDNSCount++;
              }
            });
          }
        });
      }
    });

    return [
      { name: "Public DNS Records", value: publicDNSCount },
      { name: "Private DNS Records", value: privateDNSCount }
    ];
  },

