          data: data,
          labelLine: {
            lineStyle: {
              color: 'rgba(255, 255, 255, 0.8)'
            }
          },
          itemStyle: {
            color: (params) => params.dataIndex === 0 ? '#22c55e' : '#3b82f6' // Green for Public, Blue for Private
          }
